import React, { useState, useEffect } from 'react';
import {useNavigate } from 'react-router-dom';
import Header from './Header';


const bookings = () => {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [selectedListing, setSelectedListing] = useState(null);
  const [updateBookingData, setUpdateBookingData] = useState({
    title: '',
    description: '',
    city: '',
    state: '',
    zip_code: '',
    price: '',
  });

  useEffect(() => {
    fetch(`http://127.0.0.1:5000/user/${localStorage.getItem('id')}/bookings`)
    .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setBookings(data);
      })
      .catch((error) => {
        console.error('Error fetching property bookings:', error);
      });
  }, []);

  console.log(bookings);
  const handleDeleteListing = (id) => {
    fetch(`http://127.0.0.1:5000/bookings/${id}`, {
      method: 'DELETE',
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        // setbookings(data);

      })
      .catch((error) => {
        console.error('Error deleting property listing:', error);
      })
      .finally(() => {
        navigate('/bookings-Page');
        window.location.reload();
      })
      ;
  };

  const handleUpdateFormChange = (event) => {
    const fieldName = event.target.name;
    const fieldValue = event.target.value;
    const newFormData = { ...updateBookingData };
    newFormData[fieldName] = fieldValue;
    setUpdateBookingData(newFormData);
  };

  const handleUpdateListing = () => {
    const addUserToFormData = { ...updateBookingData, user_id: localStorage.id };
    fetch(`http://127.0.0.1:5000/bookings/${selectedListing.id}`, {
      method: 'PATCH',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(addUserToFormData),
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setbookings(data);
        setSelectedListing(null);
        setUpdateFormData({
          title: '',
          description: '',
          city: '',
          state: '',
          zip_code: '',
          price: '',
          image_url: '',
        });
      })
      .catch((error) => {
        console.error('Error updating property listing:', error);
      });
  };

  return (
    <div>
      <Header />
      <h1>bookings</h1>
      <div>
        {bookings.map((listing) => (
          <div key={listing.id} className="rental-listing">
            <img src={listing.image_url} alt="rental property" />
            <h2>{listing.title}</h2>
            <p>Description: {listing.description}</p>
            <p>City: {listing.city}</p>
            <p>State: {listing.state}</p>
            <p>Zip Code: {listing.zip_code}</p>
            <p>Price: {listing.price}</p>
            <button onClick={() => setSelectedListing(listing)}>Edit</button>
            <button onClick={() => handleDeleteListing(listing.id)}>Delete</button>
          </div>
        ))}
      </div>
      {selectedListing && (
        <div>
          <h2>Edit Listing</h2>
          <form>
            <label>
              Title:
              <input
                type="text"
                name="title"
                value={updateFormData.title}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Image URL:
              <input
                type="text"
                name="image_url"
                value={updateFormData.image_url}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Description:
              <input
                type="text"
                name="description"
                value={updateFormData.description}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              City:
              <input
                type="text"
                name="city"
                value={updateFormData.city}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              State:
              <input
                type="text"
                name="state"
                value={updateFormData.state}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Zip Code:
              <input
                type="text"
                name="zip_code"
                value={updateFormData.zip_code}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Price:
              <input
                type="text"
                name="price"
                value={updateFormData.price}
                onChange={handleUpdateFormChange}
              />
            </label>
            <button onClick={handleUpdateListing}>Update Listing</button>
          </form>
        </div>
      )}
    </div>
  );
};

export default bookings;
